const SERVER_ROUTE = {
  ACCOUNT_BY_PUUID: () => "/api/account/",
  ACCOUNT_BY_PUUID: () => "/api/account/",
  SUMMONER_BY_PUUID: (puuid) => `/api/summoner?puuid=${puuid}`,
  MATCH_HISTORY_BY_PUUID: () => "/api/match-history/",
  MATCH: () => "/api/atch/",
};

module.exports = { SERVER_ROUTE };
